import React from 'react'
import "./Taskbar.sass"
import { GiOpenFolder } from "react-icons/gi";

function Taskbar() {
    return (
        <div className='taskbar'>
            <GiOpenFolder className='taskbar-folder' />
            <h1 className='taskbar-text'> TEXT </h1>
        </div>
    )
}

export default Taskbar
